import { Button } from '@material-ui/core';
import React from 'react';


class Home extends React.Component {
  constructor() {
    super();
    this.state = {};
  }
  renderHome(){
    return (
      <div id="container">
       <Button>Scrape Wikapedia for all N64 Games</Button>
      </div>
    );
  }
  render() {
    return (
      <div>
      {this.renderHome()}
      </div>
    )
  }
}

export default Home
